import React from 'react';

const Navbar = () => (
  <nav className="navbar navbar-expand-lg navbar-dark" style={{ backgroundColor: '#f8aebe' }}>
    <div className="container justify-content-center">
      <span className="navbar-brand h1 mb-0 text-dark fw-bold">HOAX</span>
    </div>
  </nav>
);

export default Navbar;
